
def f(data):
    for i in range(4, len(data)):
        ss = data[i-4:i]
        if len(ss) == len(set(ss)):
            return i

assert f('bvwbjplbgvbhsrlpgdmjqwftvncz') ==5
assert f('nppdvjthqldpwncqszvftbrmjlhg') ==6
assert f('nznrnfrfntjfmvfwmzdfjlvtqnbhcprsg') ==10
assert f('zcfzfwzzqfrljwzlrfnpqdbhtmscgvjw') ==11

data = ''
print(f(data))